//import logo from './logo.svg';
import {BrowserRouter as Router, Route} from 'react-router-dom' ;
import 'bootstrap/dist/css/bootstrap.min.css' ;

import Navbar from './Components/Navbar.component' ;
import Result from './Components/Result.component' ;
import AddComp from './Components/AddComp.component';
import AddDep from './Components/AddDep.component';
import AddCandid from './Components/AddCandid.component'; 

function App() {
  return (
    <Router>
      <Navbar>
          <Route path='/' Exact Component={Result} />
          <Route path='/AddComp' Exact Component={AddComp} />
          <Route path='/AddDep' Exact Component={AddDep} />
          <Route path='/AddCandid' Exact Component={AddCandid} />
      </Navbar>
    </Router>
  );
}

export default App;
